const initialState = {

    books : {id:5, name: 'mybook'},
}

export default function (state = initialState, action) {
    switch (action.type) {
        case 'GET_BOOKS':
            console.log(action.payload);
            return {
                ...state,
                books : action.payload
            };
        default:
            return state;

    }
}
